import React from "react";
import { Container } from "react-bootstrap";
import Sdata from "./data";
function Box3() {
    return (<Container>
        <div className="">
         
                {Sdata.map((val) => {
                    return (<>
                        <div className="par2">
                    <ul>
                        <li>{val.title}</li>
                        <li>{val.skill}</li>
                        <li>{val.framework}</li>
                        <li>{val.language}</li>
                        <li>{val.db}</li>
                        <li>{val.Alter}</li>

                        </ul>
                        </div>
                    </>)
                })}

       

        </div>
    </Container>)
}
export default Box3
